contracts/Parcel.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

struct Parcel_land {
    uint parcel_no;
    string owner_name;
    uint price;
    uint area;
}

// ภาระผูกพัน
struct Olgt {
    string olgt_name;
    uint olgt_price;
}

contract Parcel {
    address owner;
    Parcel_land parcel_land;
    mapping(address=>Parcel_land) _parcel_land;
    mapping(address=>Olgt) _olgt;

    constructor() {
        owner = msg.sender;
    }

    modifier isOwner {
        require(msg.sender == owner, "You are not parcel owner.");
        _;
    }


    // สร้าง จดทะเบียนโฉนดที่ดิน
    function createParcel(uint parcel_no, string memory owner_name, uint price, uint area) public payable {
       _parcel_land[owner].parcel_no = parcel_no;
       _parcel_land[owner].owner_name = owner_name;
       _parcel_land[owner].price = price;
       _parcel_land[owner].area = area;
    }

    //จำนอง + เปลี่ยนผู้ถือกรรมสิทธิ์เป็นธนาคาร
    function mortgage(string memory owner_name, uint price) public payable {
        _parcel_land[owner].owner_name = owner_name;
        _olgt[owner].olgt_name = owner_name;
        _olgt[owner].olgt_price = price;
    }

    //ไถ่ถอนจำนอง + เปลี่ยนผู้ถือกรรมสิทธิ์
    function redeem(string memory owner_name, uint price) public payable {
        require(_olgt[owner].olgt_price >= price, "Insufficient fund for redeem.");
        _parcel_land[owner].owner_name = owner_name;
        _olgt[owner].olgt_name = "";
        _olgt[owner].olgt_price = 0;
    }

}

